-- 导出  表 ads.context 结构
DROP TABLE IF EXISTS `context`;
CREATE TABLE IF NOT EXISTS `context` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) DEFAULT NULL,
  `model` enum('mistral','qwen2.5','llama2-uncensored','llama3.2','phi4','gemma2','deepseek-r1') DEFAULT NULL,
  `role` enum('user','assistant','system') DEFAULT NULL,
  `brand_id` int(10) unsigned DEFAULT NULL,
  `ip` varchar(50) DEFAULT NULL,
  `user_agent` text DEFAULT NULL,
  `content` longtext DEFAULT NULL,
  `created` timestamp NOT NULL DEFAULT curdate(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=340 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci;

